        </div> */}
      {/* <strong className="title">
        Dashboard for Chatbot Performance</strong> */}
        <Header />
      <div className="container">
        <div className="left">
          <Metric />
        </div>
        <div className="right">
          <Piechart />
        </div>
        <div className="left">
          <Barchart />
        </div>
        <div className="right">
          <Wordcloud />
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default App;
